        private void emplace_back()
        {
            this.Add(new node());
        }

        public class TreeComparer : IComparer<int>
        {
            node n;
            int v;
            public TreeComparer(node n, int v)
            {
                this.n = n;
                this.v = v;
            }

            public int Compare(int val1, int val2)
            {
                double d1 = x[n.samples[val1], v];
                double d2 = x[n.samples[val2], v];

                if (d1 > d2)
                    return 1;
                else if (d1 < d2)
                    return -1;
                return 0;
            }
        }

        private Random rnd = new Random();

        private float u01random()
        {
            //return UnityEngine.Random.Range(0.0f, 1.0f);
            return (float)rnd.NextDouble();
        }

        //! Trains an empty tree from bootstrap samples.
        public void train(int mtry)
        {
            // Create bootstrap samples with replacement.
            this.Capacity = (ns << 1) - 1;
            //this.Reverse(0, (ns << 1) - 1);
            //reserve((ns << 1) - 1);
            emplace_back();
            node root = this[0];// front();
            root.samples=new List<int>(ns); //.resize(ns);
            //for (size_t& s : root.samples)
            //{
            //    s = static_cast<size_t>(u01() * ns);
            //}
            for (int kk = 0; kk < ns; kk++)
            {
                //root.samples[kk] = (int)(u01() * ns);
                int v = (int)(u01random() * ns);
                root.samples.Add(v);
            }

            // Populate nodes.
            for (int k = 0; k < this.Count; ++k)
            {
                node n = this[k];

                // Evaluate node y and purity.
                float sum = 0;
                foreach (int s in n.samples)
                    sum += (float)y[s];
                n.y = 0.0f;
                if (n.samples.Count > 0)
                    n.y = sum / n.samples.Count;
                n.p = sum * n.y; // = n.y * n.y * n.samples.size() = sum * sum / n.samples.size().

                // Do not split the node if it contains too few samples.
                if (n.samples.Count <= 5) continue;

                // Find the best split that has the highest increase in node purity.
                float bestChildNodePurity = n.p;
                //array<int, nv> mind;
                int[] mind = new int[nv];
                //iota(mind.begin(), mind.end(), 0);
                for (int i = 0; i < mtry; ++i)
                {
                    // Randomly select a variable without replacement.
                    int j = (int)(u01random() * (nv - i));
                    int v = mind[j];
                    mind[j] = mind[nv - i - 1];

                    // Sort the samples in ascending order of the selected variable.
                    List<int> ncase = new List<int>(n.samples.Count);
                    for (int kk = 0; kk < n.samples.Count; kk++)
                        ncase.Add(kk);
                    //iota(ncase.begin(), ncase.end(), 0);
                    ncase.Sort(new TreeComparer(n, v));
                    //sort(ncase.begin(), ncase.end(), [&n, v]( int val1,  int val2)
                    //{
                    //    return x[n.samples[val1]][v] < x[n.samples[val2]][v];
                    //});



                    // Search through the gaps in the selected variable.
                    float suml = 0;
                    float sumr = sum;
                    int popl = 0;
                    int popr = n.samples.Count;
                    for (j = 0; j < n.samples.Count - 1; ++j)
                    {
                        assert(j<ncase.Count);
                        int sampleindex = ncase[j];
                        assert(sampleindex < n.samples.Count);
                        int samplevalue = n.samples[sampleindex];
                        float d = (float)y[samplevalue];
                        suml += d;
                        sumr -= d;
                        ++popl;
                        --popr;
                        if (x[n.samples[ncase[j]],v] == x[n.samples[ncase[j + 1]],v]) continue;
                        float curChildNodePurity = (suml * suml / popl) + (sumr * sumr / popr);
                        if (curChildNodePurity > bestChildNodePurity)
                        {
                            bestChildNodePurity = curChildNodePurity;
                            n.var = v;
                            n.val = ((float)x[n.samples[ncase[j]], v] + (float)x[n.samples[ncase[j + 1]], v]) * 0.5f;
                        }
                    }
                }

                // Do not split the node if purity does not increase.
                if (bestChildNodePurity == n.p) continue;

                // Create two child nodes and distribute samples.
                n.children[0] = this.Count;
                emplace_back();
                n.children[1] = this.Count;
                emplace_back();
                foreach (int s in n.samples)
                {
                    float v = (float)x[s, n.var];
                    int index = v > n.val ? 1 : 0;
                    this[n.children[index]].samples.Add(s);
                }
            }
        }

        //! Predicts the y value of the given sample x.
        public float PredictsY(ref List<float> x)
        {
            //size_t k;
            //for (k = 0; (*this)[k].children[0]; k = (*this)[k].children[x[(*this)[k].var] > (*this)[k].val]) ;
            //return (*this)[k].y;

            int k = 0;
            for (k = 0; this[k].children[0] != 0; )
            {
                float v = x[this[k].var];
                int index = v > this[k].val ? 1 : 0;
                k = this[k].children[index];
            }
            return this[k].y;
        }

        //! Clears node samples to save memory.
        public void clear()
        {
            foreach (node n in this)
            {
                n.samples.Clear();
            }
        }


